import logo from './logo.svg';

import Rectangle from "./components/Rectangle";
import Block from "./components/Block";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <div style={{
              backgroundColor: "lightblue",
              height: "100%",
              width: "100%"
          }}
               />

      </header>
    </div>
  );
}

export default App;
